import React, {Component} from "react";

import Header from "./Component/Header";
import Card from "./Component/Card";
import Cart from "./Component/Cart";

const itemsCard = [
    {name: 'Мужские Кроссовки Nike Blazer Mid Suede' , price: 12999, img: '/img/1.jpg'},
    {name: 'Мужские Кроссовки Nike Blazer Mid Suede' , price: 13999, img: '/img/2.jpg'},
    {name: 'Мужские Кроссовки Nike Blazer Mid Suede' , price: 14999, img: '/img/3.jpg'},
    {name: 'Мужские Кроссовки Nike Blazer Mid Suede' , price: 15999, img: '/img/4.jpg'}
]

class App extends Component{
  constructor(props) {
    super(props);
  }
  render() {

    return(
        <div className='wrapper clear'>
            <Cart />
            <Header />

            <main className="df p-40">
                <div className="d-flex align-center justify-between mb-40">
                    <h1 className='mb-40'>Все кроссовки</h1>
                    <div className="search-block d-flex">
                        <img src="/img/search.svg"/>
                        <input type="text" placeholder='Поиск...'/>
                    </div>
                </div>

                <div className="sneakers d-flex flex-wrap align-center">
                    {
                        itemsCard.map((item) => (
                            <Card tovar = {item}/>
                        ))
                    }
                </div>
            </main>
        </div>
    )
  }
}

export default App;
